DROP TABLE IF EXISTS event CASCADE;
CREATE TABLE event (
	id integer PRIMARY KEY GENERATED ALWAYS AS IDENTITY,
	name varchar NOT NULL,
	starting_date timestamp NOT NULL,
	ending_date timestamp NOT NULL,
	street_name varchar NOT NULL,
	house_number integer CHECK (house_number BETWEEN 1 AND 999),
	postal_code integer CHECK (postal_code IS NOT NULL AND (postal_code BETWEEN 999 AND 9999)),
	city varchar NOT NULL,
	children_accepted boolean NOT NULL,
	description varchar NOT NULL,
	type varchar NOT NULL,
	security_level integer CHECK (security_level IS NOT NULL AND (security_level BETWEEN 1 AND 5)),
	require_mask boolean NOT NULL,
	require_covid_safe_ticket boolean NOT NULL,
	max_place_count integer NOT NULL,
	mail_address_creator varchar NOT NULL,

	CONSTRAINT fk_event_user FOREIGN KEY(mail_address_creator) REFERENCES users(mail_address) DEFERRABLE INITIALLY DEFERRED
);

